pragma solidity ^0.8.0;

import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/IERC721.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/IERC721Receiver.sol";
import "../node_modules/openzeppelin-solidity/contracts/token/ERC721/extensions/IERC721Metadata.sol";
import "../node_modules/openzeppelin-solidity/contracts/utils/Address.sol";
import "../node_modules/openzeppelin-solidity/contracts/utils/Context.sol";
import "../node_modules/openzeppelin-solidity/contracts/utils/Strings.sol";
import "../node_modules/openzeppelin-solidity/contracts/utils/introspection/ERC165.sol";

// Based on ERC721.sol
contract NftMarathon is Context, ERC165, IERC721, IERC721Metadata {
  using Address for address;
  using Strings for uint256;
  string private _name; // Token name
  string private _symbol; // Token symbol
  NftObject[] private _nftObjects; // Mapping from token ID to owner address
  mapping(uint256 => address) private _owners; // Mapping from token ID to owner address
  mapping(address => uint256) private _balances; // Mapping owner address to token count
  mapping(uint256 => address) private _tokenApprovals; // Mapping from token ID to approved address
  mapping(address => mapping(address => bool)) private _operatorApprovals; // Mapping from owner to operator approvals
  uint256 private _currentTokenCount;

  struct NftObject {
    string data;
    address holder;
    uint256 tokenId;
  }

  constructor() public {
    _name = "NftMarathon";
    _symbol = "NFTADS";
  }

  function _baseURI() public view returns (string memory) {
    return "http://nftmarathon.xyz/tokens/";
  }

  // Custom accessor to create a unique token
  function mintUniqueToken() public returns (uint256) {
    _currentTokenCount++;
    _mint(msg.sender, _currentTokenCount); // Minting the standard ERC721
    return _currentTokenCount;
  }

  function mintUniqueTokenWithData(string memory _data) public returns (uint256) {
    _currentTokenCount++;
    _mint(msg.sender, _currentTokenCount); // Minting the standard ERC721
    NftObject memory newNft = NftObject(_data, msg.sender, _currentTokenCount);
    _nftObjects.push(newNft);
    return _currentTokenCount;
  }

  function getAllNftObjects() public view returns (NftObject[] memory){
    return _nftObjects;
  }


//
//  function getOwnersMapping(address _to) public view returns (mapping(uint256 => address) memory) {
//    return _owners;
//  }

  function getAll() public view returns (address[] memory){
    address[] memory ret = new address[](_currentTokenCount);
    for (uint i = 0; i < _currentTokenCount; i++) {
      ret[i] = _owners[i];
    }
    return ret;
  }

  function getAll2() public view returns (uint256[] memory){
    uint256[] memory ret = new uint256[](20);
    for (uint i = 0; i < 10; i++) {
      ret[i] = i;
    }
    return ret;
  }

  function getAll3() public view returns (uint256){
    return 2000;
  }

  uint256 value = 2020211;
  function setValue(uint256 _value) public {
    value = _value;
  }

  function getValue() view public returns (uint256) {
    return value;
  }


  /**
   * @dev See {IERC165-supportsInterface}.
     */
  function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
    return
    interfaceId == type(IERC721).interfaceId ||
  interfaceId == type(IERC721Metadata).interfaceId ||
  super.supportsInterface(interfaceId);
  }

  /**
   * @dev See {IERC721-balanceOf}.
     */
  function balanceOf(address owner) public view virtual override returns (uint256) {
    require(owner != address(0), "ERC721: balance query for the zero address");
    return _balances[owner];
  }

  /**
   * @dev See {IERC721-ownerOf}.
     */
  function ownerOf(uint256 tokenId) public view virtual override returns (address) {
    address owner = _owners[tokenId];
    require(owner != address(0), "ERC721: owner query for nonexistent token");
    return owner;
  }

  /**
   * @dev See {IERC721Metadata-name}.
     */
  function name() public view virtual override returns (string memory) {
    return _name;
  }

  /**
   * @dev See {IERC721Metadata-symbol}.
     */
  function symbol() public view virtual override returns (string memory) {
    return _symbol;
  }

  /**
   * @dev See {IERC721Metadata-tokenURI}.
     */
  function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
    require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

    string memory baseURI = _baseURI();
    return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI, tokenId.toString())) : "";
  }



  /**
   * @dev See {IERC721-approve}.
     */
  function approve(address to, uint256 tokenId) public virtual override {
    address owner = NftMarathon.ownerOf(tokenId);
    require(to != owner, "ERC721: approval to current owner");

    require(
      _msgSender() == owner || isApprovedForAll(owner, _msgSender()),
      "ERC721: approve caller is not owner nor approved for all"
    );

    _approve(to, tokenId);
  }

  /**
   * @dev See {IERC721-getApproved}.
     */
  function getApproved(uint256 tokenId) public view virtual override returns (address) {
    require(_exists(tokenId), "ERC721: approved query for nonexistent token");

    return _tokenApprovals[tokenId];
  }

  /**
   * @dev See {IERC721-setApprovalForAll}.
     */
  function setApprovalForAll(address operator, bool approved) public virtual override {
    require(operator != _msgSender(), "ERC721: approve to caller");

    _operatorApprovals[_msgSender()][operator] = approved;
    emit ApprovalForAll(_msgSender(), operator, approved);
  }

  /**
   * @dev See {IERC721-isApprovedForAll}.
     */
  function isApprovedForAll(address owner, address operator) public view virtual override returns (bool) {
    return _operatorApprovals[owner][operator];
  }

  /**
   * @dev See {IERC721-transferFrom}.
     */
  function transferFrom(
    address from,
    address to,
    uint256 tokenId
  ) public virtual override {
    //solhint-disable-next-line max-line-length
    require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");

    _transfer(from, to, tokenId);
  }

  /**
   * @dev See {IERC721-safeTransferFrom}.
     */
  function safeTransferFrom(
    address from,
    address to,
    uint256 tokenId
  ) public virtual override {
    safeTransferFrom(from, to, tokenId, "");
  }

  /**
   * @dev See {IERC721-safeTransferFrom}.
     */
  function safeTransferFrom(
    address from,
    address to,
    uint256 tokenId,
    bytes memory _data
  ) public virtual override {
    require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
    _safeTransfer(from, to, tokenId, _data);
  }

  /**
   * @dev Safely transfers `tokenId` token from `from` to `to`, checking first that contract recipients
     * are aware of the ERC721 protocol to prevent tokens from being forever locked.
     *
     * `_data` is additional data, it has no specified format and it is sent in call to `to`.
     *
     * This internal function is equivalent to {safeTransferFrom}, and can be used to e.g.
     * implement alternative mechanisms to perform token transfer, such as signature-based.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `tokenId` token must exist and be owned by `from`.
     * - If `to` refers to a smart contract, it must implement {IERC721Receiver-onERC721Received}, which is called upon a safe transfer.
     *
     * Emits a {Transfer} event.
     */
  function _safeTransfer(
    address from,
    address to,
    uint256 tokenId,
    bytes memory _data
  ) internal virtual {
    _transfer(from, to, tokenId);
    require(_checkOnERC721Received(from, to, tokenId, _data), "ERC721: transfer to non ERC721Receiver implementer");
  }

  /**
   * @dev Returns whether `tokenId` exists.
     *
     * Tokens can be managed by their owner or approved accounts via {approve} or {setApprovalForAll}.
     *
     * Tokens start existing when they are minted (`_mint`),
     * and stop existing when they are burned (`_burn`).
     */
  function _exists(uint256 tokenId) internal view virtual returns (bool) {
    return _owners[tokenId] != address(0);
  }

  /**
   * @dev Returns whether `spender` is allowed to manage `tokenId`.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
  function _isApprovedOrOwner(address spender, uint256 tokenId) internal view virtual returns (bool) {
    require(_exists(tokenId), "ERC721: operator query for nonexistent token");
    address owner = NftMarathon.ownerOf(tokenId);
    return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
